/**
 * 高性能无序数组，delete采用交换法提升行,内部数只扩不缩。
 */
export declare class DisorderedArray<T> {
    _elements: T[];
    length: number;
    constructor(count?: number);
    add(element: T): void;
    delete(element: T): void;
    /**
     *
     * @param index
     * @returns 被替换过来的项 用于外部重置他的index
     */
    deleteByIndex(index: number): T;
    garbageCollection(): void;
}
